import React,{Component} from 'react';
import './Bandeau.css';
import { Container, Row, Col } from 'reactstrap';


class Bandeau extends Component{
    render(){
        return(
            <Container fluid>
                <Row  className="Bandeau">
                    <Col lg="4" className="Bandeau_calendrier">
                         <p>Date</p>     
                         <p>Mois</p>    
                         <p>EquipeA</p>  
                         <p>EquipeB</p>
                         <p>Heure</p>
                         <p>Lien vers Calendrier</p>
                    </Col>
                    <Col lg="8" className="Bandeau_sponsors">
                                    lalala sponsors
                    </Col>
                </Row>
            </Container>
        )
    }
}

export default Bandeau;
